			@"<NameCulture>  <Counts>    <Count Usage=""0"" Min=""1"" Max=""1""/>    <Count Usage=""3"" Min=""0"" Max=""3""/>    <Count Usage=""6"" Min=""1"" Max=""1""/>    <Count Usage=""2"" Min=""0"" Max=""1""/>  </Counts>  <Patterns>    <Pattern Style=""0"" Text=""{0}"" Params=""0""/>    <Pattern Style=""1"" Text=""{0} {1}"" Params=""0,6""/>    <Pattern Style=""2"" Text=""{0} {1} {2}"" Params=""0,3,6""/>    <Pattern Style=""3"" Text=""{0}"" Params=""2""/>    <Pattern Style=""4"" Text=""{0}"" Params=""6""/>    <Pattern Style=""5"" Text=""{0} &quot;{2}&quot; {1}"" Params=""0,6,2""/>  </Patterns>  <Elements>    <Element Usage=""0"" MinimumCount=""1"" MaximumCount=""1"" Name=""Given Name""><![CDATA[A person's given name, in Western contexts often referred to as a first name or forename, is a part of his or her personal name and identifies and differentiates the person between members of a group, especially in a family, all of whose members usually share the same family name (surname). A given name is purposefully given, usually by a child's parents at or near birth, in contrast to an inherited one such as a family name. A given name is sometimes legally changed through a name change. Given names are often used in a familiar and friendly manner in informal situations. The idiom ""on a first-name basis"" (or ""on first-name terms"") alludes to the familiarity of addressing another by a given name.]]></Element>    <Element Usage=""3"" MinimumCount=""0"" MaximumCount=""3"" Name=""Middle Name""><![CDATA[Middle names are normally chosen by parents at the same time as the first name. Names that are popular as first names are also popular as middle names. The given name of a relative is often used because of tradition or to show esteem. A middle name may be chosen which might have been a social burden to the child as a first name, perhaps because it is unusual or indicates a particular cultural background. Surnames are also sometimes used as middle names, usually to honor a relative. A child is sometimes given a middle name that is the first or middle name of one of his or her parents. In the United States, it is also common for a baby boy to be given the same given name as his father, in which case the middle name may be used as if a first name so as to distinguish him from his father. A similar, but rarer, practice is for children to have their mother's maiden name as their middle name.]]></Element>    <Element Usage=""6"" MinimumCount=""1"" MaximumCount=""1"" Name=""Family Name""><![CDATA[A surname is a name added to a given name and is part of a personal name. In many cases, a surname is a family name and many dictionaries define ""surname"" as a synonym of ""family name"". In the western hemisphere, it is commonly synonymous with ""last name"", since it is usually placed at the end of a person's given name.]]></Element>    <Element Usage=""2"" MinimumCount=""0"" MaximumCount=""1"" Name=""Nickname""><![CDATA[A nickname is ""a familiar or humorous name given to a person or thing instead of or as well as the real name."". The term hypocoristic is used to refer to a nickname of affection between those in love or with a close emotional bond, compared with a term of endearment. The term diminutive name refers to nicknames that convey smallness, hence something regarded with affection or familiarity (e.g., referring to children), or contempt.]]></Element>  </Elements>  <NameEntryRegex><![CDATA[^(?:(?<birthname>[w'-]+) )(?<middlename>(?<= )[w '-]+)*?(?<= )(?<surname>[^ ""]+)(?: ""(?<nickname>[w '-]+)""){0,1}$]]></NameEntryRegex></NameCulture>");

